import React, { useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import ProductList from './components/ProductList';
import OrderForm from './components/OrderForm';

interface CartItem {
  id: number;
  name: string;
  price: number;
  quantity: number;
}

const App: React.FC = () => {
  const [cart, setCart] = useState<CartItem[]>([]);

  const addToCart = (product: { id: number; name: string; price: number; quantity: number }) => {
    setCart(prev => {
      const existingItem = prev.find(item => item.id === product.id);
      if (existingItem) {
        return prev.map(item =>
          item.id === product.id ? { ...item, quantity: item.quantity + 1 } : item
        );
      }
      return [...prev, { ...product, quantity: 1 }];
    });
  };

  const removeFromCart = (id: number) => {
    setCart(prev => prev.filter(item => item.id !== id));
  };

  const updateCartQuantity = (id: number, quantity: number) => {
    setCart(prev =>
      prev.map(item => (item.id === id ? { ...item, quantity: Math.max(1, quantity) } : item))
    );
  };

  return (
    <div className="min-h-screen bg-gray-100">
      <header className="bg-green-700 text-white p-6 shadow-lg">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-3xl font-bold">Магазин семян и товаров для дачи</h1>
          <button
            onClick={() => window.location.href = '/order'}
            className="bg-blue-500 px-4 py-2 rounded hover:bg-blue-600"
          >
            Корзина ({cart.length})
          </button>
        </div>
      </header>

      {/* Рекламный баннер */}
      <section className="bg-green-500 text-white py-12 text-center">
        <div className="container mx-auto">
          <h2 className="text-4xl font-bold mb-4">Весенняя распродажа!</h2>
          <p className="text-xl">Скидки до 30% на все семена до конца марта!</p>
          <button className="mt-6 bg-yellow-400 text-green-800 px-6 py-3 rounded-lg hover:bg-yellow-500">
            Купить сейчас
          </button>
        </div>
      </section>

      <main className="container mx-auto p-6">
        <Routes>
          <Route path="/" element={<ProductList addToCart={addToCart} cart={cart} />} />
          <Route
            path="/order"
            element={<OrderForm cart={cart} clearCart={() => setCart([])} />}
          />
        </Routes>

        {/* Блок акций */}
        <section className="mt-12">
          <h2 className="text-2xl font-semibold mb-6">Акции</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="bg-white p-6 rounded-lg shadow-md">
              <h3 className="text-xl font-bold text-green-600">2+1 бесплатно</h3>
              <p className="text-gray-600">Купите два пакета семян, третий — в подарок!</p>
            </div>
            <div className="bg-white p-6 rounded-lg shadow-md">
              <h3 className="text-xl font-bold text-green-600">Скидка на доставку</h3>
              <p className="text-gray-600">Бесплатная доставка при заказе от 1000 руб.</p>
            </div>
          </div>
        </section>
      </main>

      <footer className="bg-green-700 text-white p-6 text-center">
        <p>© 2025 Магазин семян. Все права защищены.</p>
      </footer>
    </div>
  );
};

export default App;
